import React from "react";
import { Card, Avatar } from "antd";

const UserProfile = () => {
  return (
      <Card>
          <Card.Meta
          avatar={<Avatar>CH</Avatar>}
          title="Chaehyeon"
          />
      </Card>
  )
};

export default UserProfile;
